import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';
import { TabViewModule } from 'primeng/tabview';
import { DropdownModule } from 'primeng/dropdown';
import { ButtonModule } from 'primeng/button';
import { SharedModule } from 'app/shared/shared.module';
import { AcmReportComponent } from './acm-report.component';
import { acmReportRoute } from './acm-report.route';

@NgModule({
  imports: [SharedModule, TabViewModule, DropdownModule, ButtonModule, RouterModule.forChild(acmReportRoute)],
  declarations: [AcmReportComponent],
})
export class AcmReportModule {}
